import React from 'react';
import { Waypoint } from 'react-waypoint';

import './architektur.css';

class ArchitectureBig extends React.Component {
  constructor(props) {
    super(props);
    this.state = { showSVG: false };
    this.handleEnter = this.handleEnter.bind(this);
  }

  handleEnter() {
    this.setState({ showSVG: true });
  }

  render() {
    const { showSVG } = this.state;
    return (
      <div style={{ backgroundColor: '#002c46' }}>
        <div className="container">
          <div className="case-block row">
            <div className="col-xs-12 col-lg-3" />
            <div className="col-xs-12 col-lg-6">
              <div className="case-block__content">
                <h2 style={{ color: 'white' }}>Micro-Service-Architektur</h2>
                <h3>Mit den modernsten Technologien</h3>
                <p style={{ color: 'white' }}>
                  Damit nachhaltig Business Value entsteht, braucht es eine saubere Architektur. Dank Einsatz modernster
                  Technologien und Micro-Service-Architektur bleiben wir langfristig handlungsf√§hig.
                </p>
              </div>
            </div>
          </div>
        </div>
        <Waypoint onEnter={this.handleEnter}>
          <div className="container" style={{ backgroundColor: '#002c46' }}>
            <div style={{ margin: 'auto', maxWidth: '1300px' }}>{showSVG ? <FullSVG /> : <ApiSVG />}</div>
          </div>
        </Waypoint>
      </div>
    );
  }
}

